import React from 'react';
import Card from './Card';
import Data from './Data';



function App(){
    return (
        <>
        <h1>React Component</h1>
        {Data.map((val) => {
            return(
                <Card
                    key={val.id}
                    chabi={val.chabi}
                    nam={val.nam}
                    link={val.link}
                />
            );
            })}
        </>
    );
}
export default App;
